import React from 'react'
import styled from "styled-components";


const StyledCard = styled.div`
width: 340px;
height: 340px;
border-radius: 10px;
background-color: coral;
margin-top: 50px;
border: solid 1px black;

`

export default function Card() {
  return (
    <StyledCard>
      
    </StyledCard>
  )
}
